import React from 'react'

function App() {

  return (
    <div>
      <div style={{height:"40%"}}>
        <div className='Card'>
          <p className='Bank-Name'>Bank Name</p>
          <p className='Debit-Card-No'>XXXX XXXX XXXX XXXX</p>
          <div style={{backgroundColor:"black", height:"15%"}}></div>
          <p className='Card-details'>
            <span>Holder Name</span>
            <span>MM/YY</span>
            <span>CVV</span>
          </p>
        </div>
      </div> 
    </div>
  );
}

export default App;
